//Layout

import Menu from '../Components/Menu/Menu';


//Pages

import Profile from '../Pages/Profile';


const routes = [
    {
        path: "/",
        component: Menu,
        exact: false,
        routes: [
            {
                path: "/",
                component: Home,
                exact: true
            }, {
                path: "/profile",
                component: Profile,
                exact: true
            }
        ]
    }
]

export default routes;
